  "inlineSchema": "generator client {\n  provider = \"prisma-client-js\"\n  output   = \"../app/generated/prisma\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n//\n// ENUMS\n//\nenum UserRole {\n  ADMIN\n  MANAGER\n  EMPLOYEE\n}\n\nenum OrderStatus {\n  PENDING\n  IN_PROGRESS\n  COMPLETED\n  CANCELED\n}\n\nenum OrderType {\n  TAKE_AWAY\n  DELIVERY\n}\n\nenum ReservationStatus {\n  PENDING\n  CONFIRMED\n  COMPLETED\n  CANCELED\n  NO_SHOW\n}\n\nenum PriceType {\n  DINE_IN\n  TAKE_AWAY\n  DELIVERY\n}\n\nenum TableShape {\n  SQUARE\n  RECTANGLE\n  CIRCLE\n}\n\nenum TableStatus {\n  EMPTY\n  OCCUPIED\n  RESERVED\n  CLEANING\n}\n\n//\n// NEXTAUTH MODELS\n//\nmodel User {\n  id        String    @id @default(cuid())\n  email     String    @unique\n  name      String?\n  image     String?\n  accounts  Account[]\n  sessions  Session[]\n  createdAt DateTime  @default(now())\n\n  userOnBranches UserOnBranch[]\n}\n\nmodel Account {\n  id                String  @id @default(cuid())\n  userId            String\n  type              String\n  provider          String\n  providerAccountId String\n  refresh_token     String?\n  access_token      String?\n  expires_at        Int?\n  token_type        String?\n  scope             String?\n  id_token          String?\n  session_state     String?\n  user              User    @relation(fields: [userId], references: [id])\n}\n\nmodel Session {\n  id           String   @id @default(cuid())\n  sessionToken String   @unique\n  userId       String\n  expires      DateTime\n  user         User     @relation(fields: [userId], references: [id])\n}\n\n//\n// ORGANIZACIÓN GENERAL\n//\nmodel Restaurant {\n  id          String   @id @default(cuid())\n  name        String\n  description String?\n  phone       String?\n  logoUrl     String?\n  branches    Branch[]\n  createdAt   DateTime @default(now())\n}\n\nmodel Branch {\n  id           String     @id @default(cuid())\n  name         String\n  address      String\n  restaurant   Restaurant @relation(fields: [restaurantId], references: [id])\n  restaurantId String\n  createdAt    DateTime   @default(now())\n\n  reservations Reservation[]\n  orders       Order[]\n  tables       Table[]\n  timeSlots    TimeSlot[]\n  products     ProductOnBranch[]\n  userAccess   UserOnBranch[]\n}\n\nmodel UserOnBranch {\n  id        String   @id @default(cuid())\n  user      User     @relation(fields: [userId], references: [id])\n  userId    String\n  branch    Branch   @relation(fields: [branchId], references: [id])\n  branchId  String\n  role      UserRole\n  createdAt DateTime @default(now())\n\n  @@unique([userId, branchId])\n}\n\n//\n// MESAS Y RESERVAS\n//\nmodel Table {\n  id       String  @id @default(cuid())\n  number   Int\n  capacity Int\n  isActive Boolean @default(true)\n  isShared Boolean @default(false) // For communal/shared tables that can have multiple reservations\n\n  // Floor plan layout properties\n  positionX Float?      @default(0)\n  positionY Float?      @default(0)\n  width     Float?      @default(80)\n  height    Float?      @default(80)\n  rotation  Float?      @default(0) // in degrees\n  shape     TableShape? @default(SQUARE)\n\n  // Manual status override (null = auto-calculate from reservations)\n  status TableStatus?\n\n  branch       Branch             @relation(fields: [branchId], references: [id])\n  branchId     String\n  reservations ReservationTable[]\n}\n\nmodel Reservation {\n  id                  String             @id @default(cuid())\n  branch              Branch             @relation(fields: [branchId], references: [id])\n  branchId            String\n  customerName        String\n  customerEmail       String\n  customerPhone       String?\n  date                DateTime\n  people              Int\n  timeSlot            TimeSlot?          @relation(fields: [timeSlotId], references: [id])\n  timeSlotId          String?\n  status              ReservationStatus  @default(PENDING)\n  dietaryRestrictions String?\n  accessibilityNeeds  String?\n  notes               String?\n  createdAt           DateTime           @default(now())\n  createdBy           String?\n  updatedBy           String?\n  tables              ReservationTable[]\n\n  @@index([branchId, date, status])\n  @@index([date, timeSlotId])\n}\n\nmodel ReservationTable {\n  id            String      @id @default(cuid())\n  reservation   Reservation @relation(fields: [reservationId], references: [id])\n  reservationId String\n  table         Table       @relation(fields: [tableId], references: [id])\n  tableId       String\n\n  @@unique([reservationId, tableId])\n  @@index([tableId])\n}\n\nmodel TimeSlot {\n  id             String   @id @default(cuid())\n  startTime      DateTime @db.Time // PostgreSQL TIME type\n  endTime        DateTime @db.Time // PostgreSQL TIME type\n  daysOfWeek     String[] // Array of day names: [\"monday\", \"tuesday\", etc.]\n  pricePerPerson Decimal? @default(0) // Optional price per person, 0 for free\n  notes          String? // Optional notes/description\n  isActive       Boolean  @default(true)\n  branch         Branch   @relation(fields: [branchId], references: [id])\n  branchId       String\n  createdAt      DateTime @default(now())\n  updatedAt      DateTime @updatedAt\n\n  reservations Reservation[]\n}\n\n//\n// PRODUCTOS Y MENÚ\n//\nmodel Category {\n  id       String    @id @default(cuid())\n  name     String\n  order    Int       @default(0)\n  products Product[]\n}\n\nmodel Product {\n  id          String   @id @default(cuid())\n  name        String\n  description String?\n  isActive    Boolean  @default(true)\n  createdAt   DateTime @default(now())\n\n  categoryId String?\n  category   Category? @relation(fields: [categoryId], references: [id])\n\n  branches   ProductOnBranch[]\n  orderItems OrderItem[]\n}\n\nmodel ProductOnBranch {\n  id        String  @id @default(cuid())\n  product   Product @relation(fields: [productId], references: [id])\n  productId String\n  branch    Branch  @relation(fields: [branchId], references: [id])\n  branchId  String\n\n  stock     Int\n  isActive  Boolean        @default(true)\n  prices    ProductPrice[]\n  createdAt DateTime       @default(now())\n\n  @@unique([productId, branchId])\n}\n\nmodel ProductPrice {\n  id                String          @id @default(cuid())\n  productOnBranch   ProductOnBranch @relation(fields: [productOnBranchId], references: [id])\n  productOnBranchId String\n  type              PriceType\n  price             Decimal\n\n  @@unique([productOnBranchId, type])\n}\n\n//\n// PEDIDOS\n//\nmodel Order {\n  id       String @id @default(cuid())\n  branch   Branch @relation(fields: [branchId], references: [id])\n  branchId String\n\n  customerName  String\n  customerEmail String\n  type          OrderType\n  description   String?\n  courierName   String?\n  publicCode    String    @unique\n\n  status    OrderStatus @default(PENDING)\n  createdAt DateTime    @default(now())\n  createdBy String?\n  updatedBy String?\n\n  items OrderItem[]\n}\n\nmodel OrderItem {\n  id        String   @id @default(cuid())\n  order     Order    @relation(fields: [orderId], references: [id])\n  orderId   String\n  product   Product? @relation(fields: [productId], references: [id])\n  productId String?\n  itemName  String\n  quantity  Int\n  price     Decimal\n}\n",
